// Unchecked style\n  &:not(:checked) + span:not(.lever):before {\n    width: 0;\n    height: 0;\n    border: 3px solid transparent;\n    left: 6px;\n    top: 10px;\n    transform: rotateZ(37deg);\n    transform-origin: 100% 100%;\n  }\n\n  &:not(:checked) + span:not(.lever):after {\n    height: 20px;\n    width: 20px;\n    background-color: transparent;\n    border: 2px solid $radio-empty-color;\n    top: 0px;\n    z-index: 0;\n  }\n\n  // Checked style\n  &:checked {\n    + span:not(.lever):before {\n      top: 0;\n      left: 1px;\n      width: 8px;\n      height: 13px;\n      border-top: 2px solid transparent;\n      border-left: 2px solid transparent;\n      border-right: 2px solid $input-background;\n      border-bottom: 2px solid $input-background;\n      transform: rotateZ(37deg);\n      transform-origin: 100% 100%;\n    }\n\n    + span:not(.lever):after {\n      top: 0;\n      width: 20px;\n      height: 20px;\n      border: 2px solid $secondary-color;\n      background-color: $secondary-color;\n      z-index: 0;\n    }\n  }\n\n  // Focused styles\n  &.tabbed:focus + span:not(.lever):after {\n    border-radius: 2px;\n    border-color: $radio-empty-color;\n    background-color: rgba(0,0,0,.1);\n  }\n\n  &.tabbed:checked:focus + span:not(.lever):after {\n    border-radius: 2px;\n    background-color: $secondary-color;\n    border-color: $secondary-color;\n  }\n\n  // Disabled style\n  &:disabled:not(:checked) + span:not(.lever):before {\n    background-color: transparent;\n    border: 2px solid transparent;\n  }\n\n  &:disabled:not(:checked) + span:not(.lever):after {\n    border-color: transparent;\n    background-color: $input-disabled-solid-color;\n  }\n\n  &:disabled:checked + span:not(.lever):before {\n    background-color: transparent;\n  }\n\n  &:disabled:checked + span:not(.lever):after {\n    background-color: $input-disabled-solid-color;\n    border-color: $input-disabled-solid-color;\n  }\n}\n','/* Switch\n   ========================================================================== */\n\n.switch,\n.switch * {\n  -webkit-tap-highlight-color: transparent;\n  user-select: none;\n}\n\n.switch label {\n  cursor: pointer;\n}\n\n.switch label input[type=checkbox] {\n  opacity: 0;\n  width: 0;\n  height: 0;\n\n  &:checked + .lever {\n    background-color: $switch-checked-lever-bg;\n\n    &:before, &:after {\n      left: 18px;\n    }\n\n    &:after {\n      background-color: $switch-bg-color;\n    }\n  }\n}\n\n.switch label .lever {\n  content: "";\n  display: inline-block;\n  position: relative;\n  width: 36px;\n  height: 14px;\n  background-color: $switch-unchecked-lever-bg;\n  border-radius: $switch-radius;\n  margin-right: 10px;\n  transition: background 0.3s ease;\n  vertical-align: middle;\n  margin: 0 16px;\n\n  &:before, &:after {\n    content: "";\n    position: absolute;\n    display: inline-block;\n    width: 20px;\n    height: 20px;\n    border-radius: 50%;\n    left: 0;\n    top: -3px;\n    transition: left 0.3s ease, background .3s ease, box-shadow 0.1s ease, transform .1s ease;\n  }\n\n  &:before {\n    background-color: transparentize($switch-bg-color, .85);\n  }\n\n  &:after {\n    background-color: $switch-unchecked-bg;\n    box-shadow: 0px 3px 1px -2px rgba(0, 0, 0, 0.2), 0px 2px 2px 0px rgba(0, 0, 0, 0.14), 0px 1px 5px 0px rgba(0, 0, 0, 0.12);\n  }\n}\n\n// Switch active style\ninput[type=checkbox]:checked:not(:disabled) ~ .lever:active::before,\ninput[type=checkbox]:checked:not(:disabled).tabbed:focus ~ .lever::before {\n  transform: scale(2.4);\n  background-color: transparentize($switch-bg-color, .85);\n}\n\ninput[type=checkbox]:not(:disabled) ~ .lever:active:before,\ninput[type=checkbox]:not(:disabled).tabbed:focus ~ .lever::before {\n  transform: scale(2.4);\n  background-color: rgba(0,0,0,.08);\n}\n\n// Disabled Styles\n.switch input[type=checkbox][disabled] + .lever {\n  cursor: default;\n  background-color: rgba(0,0,0,.12);\n}\n\n.switch label input[type=checkbox][disabled] + .lever:after,\n.switch label input[type=checkbox][disabled]:checked + .lever:after {\n  background-color: $input-disabled-solid-color;\n}\n',"/* Select Field\n   ========================================================================== */\n\nselect { display: none; }\nselect.browser-default { display: block; }\n\nselect {\n  background-color: $select-background;\n  width: 100%;\n  padding: $select-padding;\n  border: $select-border;\n  border-radius: $select-radius;\n  height: $input-height;\n}\n\n.select-label {\n  position: absolute;\n}\n\n.select-wrapper {\n  &.valid .helper-text[data-success],\n  &.invalid ~ .helper-text[data-error] {\n    @extend %hidden-text;\n  }\n\n  &.valid {\n    & > input.select-dropdown {\n      @extend %valid-input-style;\n    }\n\n    & ~ .helper-text:after {\n      @extend %custom-success-message;\n    }\n  }\n\n  &.invalid {\n    & > input.select-dropdown,\n    & > input.select-dropdown:focus {\n      @extend %invalid-input-style;\n    }\n\n    & ~ .helper-text:after {\n      @extend %custom-error-message;\n    }\n  }\n\n  &.valid + label,\n  &.invalid + label {\n    width: 100%;\n    pointer-events: none;\n  }\n\n  & + label:after {\n    @extend %input-after-style;\n  }\n\n  position: relative;\n\n  input.select-dropdown {\n    &:focus {\n      border-bottom: 1px solid $input-focus-color;\n    }\n    position: relative;\n    cursor: pointer;\n    background-color: transparent;\n    border: none;\n    border-bottom: $input-border;\n    outline: none;\n    height: $input-height;\n    line-height: $input-height;\n    width: 100%;\n    font-size: $input-font-size;\n    margin: $input-margin;\n    padding: 0;\n    display: block;\n    user-select:none;\n    z-index: 1;\n  }\n\n  .caret {\n    position: absolute;\n    right: 0;\n    top: 0;\n    bottom: 0;\n    margin: auto 0;\n    z-index: 0;\n    fill: rgba(0,0,0,.87);\n  }\n\n  & + label {\n    position: absolute;\n    top: -26px;\n    font-size: $label-font-size;\n  }\n}\n\n// Disabled styles\nselect:disabled {\n  color: $input-disabled-color;\n}\n\n.select-wrapper.disabled {\n  + label {\n    color: $input-disabled-color;\n  }\n  .caret {\n    fill: $input-disabled-color;\n  }\n}\n\n.select-wrapper input.select-dropdown:disabled {\n  color: $input-disabled-color;\n  cursor: default;\n  user-select: none;\n}\n\n.select-wrapper i {\n  color: $select-disabled-color;\n}\n\n.select-dropdown li.disabled,\n.select-dropdown li.disabled > span,\n.select-dropdown li.optgroup {\n  color: $select-disabled-color;\n  background-color: transparent;\n}\n\nbody.keyboard-focused {\n  .select-dropdown.dropdown-content li:focus {\n    background-color: $select-option-focus;\n  }\n}\n\n.select-dropdown.dropdown-content {\n  li {\n    &:hover {\n      background-color: $select-option-hover;\n    }\n\n    &.selected {\n      background-color: $select-option-selected;\n    }\n  }\n}\n\n// Prefix Icons\n.prefix ~ .select-wrapper {\n  margin-left: 3rem;\n  width: 92%;\n  width: calc(100% - 3rem);\n}\n\n.prefix ~ label { margin-left: 3rem; }\n\n// Icons\n.select-dropdown li {\n  img {\n    height: $dropdown-item-height - 10;\n    width: $dropdown-item-height - 10;\n    margin: 5px 15px;\n    float: right;\n  }\n}\n\n// Optgroup styles\n.select-dropdown li.optgroup {\n  border-top: 1px solid $dropdown-hover-bg-color;\n\n  &.selected > span {\n    color: rgba(0, 0, 0, .7);\n  }\n\n  & > span {\n    color: rgba(0, 0, 0, .4);\n  }\n\n  & ~ li.optgroup-option {\n    padding-left: 1rem;\n  }\n}\n","/* File Input\n   ========================================================================== */\n\n.file-field {\n  position: relative;\n\n  .file-path-wrapper {\n    overflow: hidden;\n    padding-left: 10px;\n  }\n\n  input.file-path { width: 100%; }\n\n  .btn {\n    float: left;\n    height: $input-height;\n    line-height: $input-height;\n  }\n\n  span {\n    cursor: pointer;\n  }\n\n  input[type=file] {\n\n    // Needed to override webkit button\n    &::-webkit-file-upload-button {\n      display: none;\n    }\n\n    position: absolute;\n    top: 0;\n    right: 0;\n    left: 0;\n    bottom: 0;\n    width: 100%;\n    margin: 0;\n    padding: 0;\n    font-size: 20px;\n    cursor: pointer;\n    opacity: 0;\n    filter: alpha(opacity=0);\n  }\n}\n","/* Range\n   ========================================================================== */\n\n.range-field {\n  position: relative;\n}\n\ninput[type=range],\ninput[type=range] + .thumb {\n  @extend .no-select;\n  cursor: pointer;\n}\n\ninput[type=range] {\n  position: relative;\n  background-color: transparent;\n  border: none;\n  outline: none;\n  width: 100%;\n  margin: 15px 0;\n  padding: 0;\n\n  &:focus {\n    outline: none;\n  }\n}\n\ninput[type=range] + .thumb {\n  position: absolute;\n  top: 10px;\n  left: 0;\n  border: none;\n  height: 0;\n  width: 0;\n  border-radius: 50%;\n  background-color: $radio-fill-color;\n  margin-left: 7px;\n\n  transform-origin: 50% 50%;\n  transform: rotate(-45deg);\n\n  .value {\n    display: block;\n    width: 30px;\n    text-align: center;\n    color: $radio-fill-color;\n    font-size: 0;\n    transform: rotate(45deg);\n  }\n\n  &.active {\n    border-radius: 50% 50% 50% 0;\n\n    .value {\n      color: $input-background;\n      margin-left: -1px;\n      margin-top: 8px;\n      font-size: 10px;\n    }\n  }\n}\n\n// Shared\n@mixin range-track {\n  height: $track-height;\n  background: #c2c0c2;\n  border: none;\n}\n\n@mixin range-thumb {\n  border: none;\n  height: $range-height;\n  width: $range-width;\n  border-radius: 50%;\n  background: $radio-fill-color;\n  transition: box-shadow .3s;\n}\n\n// WebKit\ninput[type=range] {\n  -webkit-appearance: none;\n}\n\ninput[type=range]::-webkit-slider-runnable-track {\n  @include range-track;\n}\n\ninput[type=range]::-webkit-slider-thumb {\n  @include range-thumb;\n  -webkit-appearance: none;\n  background-color: $radio-fill-color;\n  transform-origin: 50% 50%;\n  margin: -5px 0 0 0;\n\n}\n\n.keyboard-focused input[type=range]:focus:not(.active)::-webkit-slider-thumb {\n  box-shadow: 0 0 0 10px rgba($radio-fill-color, .26);\n}\n\n// FireFox\ninput[type=range] {\n  /* fix for FF unable to apply focus style bug  */\n  border: 1px solid white;\n\n  /*required for proper track sizing in FF*/\n}\n\ninput[type=range]::-moz-range-track {\n  @include range-track;\n}\n\ninput[type=range]::-moz-focus-inner {\n  border: 0;\n}\n\ninput[type=range]::-moz-range-thumb {\n  @include range-thumb;\n  margin-top: -5px;\n}\n\n// hide the outline behind the border\ninput[type=range]:-moz-focusring {\n  outline: 1px solid #fff;\n  outline-offset: -1px;\n}\n\n.keyboard-focused input[type=range]:focus:not(.active)::-moz-range-thumb {\n  box-shadow: 0 0 0 10px rgba($radio-fill-color, .26);\n}\n\n// IE 10+\ninput[type=range]::-ms-track {\n  height: $track-height;\n\n  // remove bg colour from the track, we'll use ms-fill-lower and ms-fill-upper instead\n  background: transparent;\n\n  // leave room for the larger thumb to overflow with a transparent border */\n  border-color: transparent;\n  border-width: 6px 0;\n\n  /*remove default tick marks*/\n  color: transparent;\n}\n\ninput[type=range]::-ms-fill-lower {\n  background: #777;\n}\n\ninput[type=range]::-ms-fill-upper {\n  background: #ddd;\n}\n\ninput[type=range]::-ms-thumb {\n  @include range-thumb;\n}\n\n.keyboard-focused input[type=range]:focus:not(.active)::-ms-thumb {\n  box-shadow: 0 0 0 10px rgba($radio-fill-color, .26);\n}\n","/***************\n    Nav List\n***************/\n.table-of-contents {\n  &.fixed {\n      position: fixed;\n    }\n\n  li {\n    padding: 2px 0;\n  }\n  a {\n    display: inline-block;\n    font-weight: 300;\n    color: #757575;\n    padding-left: 16px;\n    height: 1.5rem;\n    line-height: 1.5rem;\n    letter-spacing: .4;\n    display: inline-block;\n\n    &:hover {\n      color: lighten(#757575, 20%);\n      padding-left: 15px;\n      border-left: 1px solid $primary-color;\n    }\n    &.active {\n      font-weight: 500;\n      padding-left: 14px;\n      border-left: 2px solid $primary-color;\n    }\n  }\n}\n",'.sidenav {\n  position: fixed;\n  width: $sidenav-width;\n  left: 0;\n  top: 0;\n  margin: 0;\n  transform: translateX(-100%);\n  height: 100%;\n  height: calc(100% + 60px);\n  height: -moz-calc(100%); //Temporary Firefox Fix\n  padding-bottom: 60px;\n  background-color: $sidenav-bg-color;\n  z-index: 999;\n  overflow-y: auto;\n  will-change: transform;\n  backface-visibility: hidden;\n  transform: translateX(-105%);\n\n  @extend .z-depth-1;\n\n  // Right Align\n  &.right-aligned {\n    right: 0;\n    transform: translateX(105%);\n    left: auto;\n    transform: translateX(100%);\n  }\n\n  .collapsible {\n    margin: 0;\n  }\n\n\n  li {\n    float: none;\n    line-height: $sidenav-line-height;\n\n    &.active { background-color: rgba(0,0,0,.05); }\n  }\n\n  li > a {\n    color: $sidenav-font-color;\n    display: block;\n    font-size: $sidenav-font-size;\n    font-weight: 500;\n    height: $sidenav-item-height;\n    line-height: $sidenav-line-height;\n    padding: 0 ($sidenav-padding * 2);\n\n    &:hover { background-color: rgba(0,0,0,.05);}\n\n    &.btn, &.btn-large, &.btn-flat, &.btn-floating {\n      margin: 10px 15px;\n    }\n\n    &.btn,\n    &.btn-large,\n    &.btn-floating { color: $button-raised-color; }\n    &.btn-flat { color: $button-flat-color; }\n\n    &.btn:hover,\n    &.btn-large:hover { background-color: lighten($button-raised-background, 5%); }\n    &.btn-floating:hover { background-color: $button-raised-background; }\n\n    & > i,\n    & > [class^="mdi-"], li > a > [class*="mdi-"],\n    & > i.material-icons {\n      float: left;\n      height: $sidenav-item-height;\n      line-height: $sidenav-line-height;\n      margin: 0 ($sidenav-padding * 2) 0 0;\n      width: $sidenav-item-height / 2;\n      color: rgba(0,0,0,.54);\n    }\n  }\n\n\n  .divider {\n    margin: ($sidenav-padding / 2) 0 0 0;\n  }\n\n  .subheader {\n    &:hover {\n      background-color: transparent;\n    }\n\n    cursor: initial;\n    pointer-events: none;\n    color: rgba(0,0,0,.54);\n    font-size: $sidenav-font-size;\n    font-weight: 500;\n    line-height: $sidenav-line-height;\n  }\n\n  .user-view {\n    position: relative;\n    padding: ($sidenav-padding * 2) ($sidenav-padding * 2) 0;\n    margin-bottom: $sidenav-padding / 2;\n\n    & > a {\n      &:hover { background-color: transparent; }\n      height: auto;\n      padding: 0;\n    }\n\n    .background {\n      overflow: hidden;\n      position: absolute;\n      top: 0;\n      right: 0;\n      bottom: 0;\n      left: 0;\n      z-index: -1;\n    }\n\n    .circle, .name, .email {\n      display: block;\n    }\n\n    .circle {\n      height: 64px;\n      width: 64px;\n    }\n\n    .name,\n    .email {\n      font-size: $sidenav-font-size;\n      line-height: $sidenav-line-height / 2;\n    }\n\n    .name {\n      margin-top: 16px;\n      font-weight: 500;\n    }\n\n    .email {\n      padding-bottom: 16px;\n      font-weight: 400;\n    }\n  }\n}\n\n\n// Touch interaction\n.drag-target {\n  // Right Align\n  &.right-aligned {\n    right: 0;\n  }\n\n  height: 100%;\n  width: 10px;\n  position: fixed;\n  top: 0;\n  z-index: 998;\n}\n\n\n// Fixed Sidenav shown\n.sidenav.sidenav-fixed {\n  // Right Align\n  &.right-aligned {\n    right: 0;\n    left: auto;\n  }\n\n  left: 0;\n  transform: translateX(0);\n  position: fixed;\n}\n\n// Fixed Sidenav hide on smaller\n@media #{$medium-and-down} {\n  .sidenav {\n    &.sidenav-fixed {\n      transform: translateX(-105%);\n\n      &.right-aligned {\n        transform: translateX(105%);\n      }\n    }\n\n    > a {\n      padding: 0 $sidenav-padding;\n    }\n\n    .user-view {\n      padding: $sidenav-padding $sidenav-padding 0;\n    }\n  }\n}\n\n\n.sidenav .collapsible-body > ul:not(.collapsible) > li.active,\n.sidenav.sidenav-fixed .collapsible-body > ul:not(.collapsible) > li.active {\n  background-color: $primary-color;\n  a {\n    color: $sidenav-bg-color;\n  }\n}\n